  return (
  <>
   <div className='main_note'>
     <form>
         <input type='text' placeholder='Title' autoComplete='off' />
         <textarea rows="" column="" placeholder="Write A Note..." ></textarea>
         <Button>
            <AddIcon className="plus_sign" />
         </Button>
     </form>
